import React, { useState, useEffect } from 'react';

export default function AdminReq() {
  const [garageRequests, setGarageRequests] = useState([]);

  useEffect(() => {
    fetchGarageRequests();
  }, []);

  async function fetchGarageRequests() {
    try {
      const response = await fetch('/api/requests/garage');
      const data = await response.json();

      if (data.success) {
        setGarageRequests(data.garageRequests);
      }
    } catch (error) {
      console.error(error);
    }
  }

  async function updateGarageRequestStatus(requestId, status) {
    // Implement this function to update the status of the request with the given ID
  }

  function handleActionClick(requestId) {
    showModal(requestId);
  }

  function handleAcceptClick(requestId) {
    updateGarageRequestStatus(requestId, 'accepted')
      .then(() => {
        closeModal();
        fetchGarageRequests();
      })
      .catch((error) => {
        console.error(error);
      });
  }

  function handleDeclineClick(requestId) {
    updateGarageRequestStatus(requestId, 'declined')
      .then(() => {
        closeModal();
        fetchGarageRequests();
      })
      .catch((error) => {
        console.error(error);
      });
  }

  function showModal(requestId) {
    // Implement this function to show the modal with the given request ID
  }

  function closeModal() {
    // Implement this function to hide the modal
  }

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Email</th>
            <th>Service Type</th>
            <th>Location</th>
            <th>Vehicle Number</th>
            <th>Vehicle Make</th>
            <th>Vehicle Type</th>
            <th>Additional Details</th>
            <th>Assigned Admin</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {garageRequests.map((garageRequest) => (
            <tr key={garageRequest._id}>
              <td>{garageRequest.email}</td>
              <td>{garageRequest.service_type}</td>
              <td>{garageRequest.location}</td>
              <td>{garageRequest.vehicle_number}</td>
              <td>{garageRequest.vehicle_make}</td>
              <td>{garageRequest.vehicle_type}</td>
              <td>{garageRequest.additional_details}</td>
              <td>{garageRequest.assigned_admin}</td>
              <td>{garageRequest.status}</td>
              <td>
                <button
                  className="action-button"
                  onClick={() => handleActionClick(garageRequest._id)}
                >
                  Action
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Modal */}
      <div id="modal-container">
        <div id="modal-content">
          <p>Are you sure you want to accept this request?</p>
          <div>
            <button id="accept-button" onClick={() => handleAcceptClick(requestId)}>
                ACCEPT</button>
                <button id="decline-button" onClick={() => handleDeclineClick(requestId)}>
                ACCEPT</button>
                </div>
                </div>
                </div>
                </div>
                );}
